import getPhotoApi from './@api/photo';
import React from 'react';

class App extends React.Component {
  state={
    photos:[],
    loaded:false,
    chklist:[],
  };
  async componentDidMount() {
    const data = await getPhotoApi.getPhotoList(1,12,this.state.chklist);
    console.log(typeof(data));
    this.setState({photos:data, loaded:true});
    console.log(this.state.photos[0].id);
  }
  render() {
    if(!this.state.loaded) return <></>;
    else return <div>
      {this.state.photos[0].id}
    </div>
  }
}


export default App;
